  .callout-content {
    margin-top:30vh;
    opacity:0;
    animation:fadeIn ease-in 1;
    animation-fill-mode:forwards;
    animation-duration:0.5s;
    animation-delay: 0.5s;
    @include breakpoint(small only) {
      margin-top:23vh;
    }
  }

  .balloon {
    width:125px;
    position: absolute;
    bottom:10%;
    left:10%;
    animation: floatup 30s ease forwards;
    @include breakpoint(small only) {
      bottom:10%;
      left:-64px;
    }
  }


  .resources {
    margin-top:50px;
    @include breakpoint(medium down) {
      padding-left:20px;
      padding-right:20px;
    }
    .cell {
      top: 0;
      transition: top 0.25s;
      position:relative;
      background: white;
      height: 300px;
      padding: 20px 30px 40px;
      margin-bottom: 20px;
      display: flex;
      justify-content: center; /* align horizontal */
      align-items: center; /* align vertical */
      text-align: center;
      flex-flow: wrap;
      color:$body-font-color;
      font-size:15px;
      a {
        color:$body-font-color;
        &:hover {
          color:$secondary-color;
        }
      }
      p {
        margin-top:0;
        margin-bottom:0;
      }
      h5 {
        color:$secondary-color;
        margin-bottom:5px;
      }
      img {
        width:100px;
        height:auto;
      }
      &:hover {
        top: -8px;
        color:$body-font-color;
        h5 {
          color:$secondary-color;

        }
      }
    }
  }


  #transportation {
    @include breakpoint(medium down) {
      padding-left:20px;
      padding-right:20px;
    }
  }
  .transportation-resources {
    .cell {
      top: 0;
      transition: top 0.25s;
      position:relative;
      background: white;
      height: 230px;
      padding: 30px;
      margin-bottom: 0px;
      display: flex;
      justify-content: center; /* align horizontal */
      align-items: center; /* align vertical */
      text-align: center;
      flex-flow: wrap;
      color:$body-font-color;
      a {
        color:$body-font-color;
        &:hover {
          color:$secondary-color;
        }
      }
      p {
        margin-top:0;
        margin-bottom:0;
      }
      h5 {
        color:$secondary-color;
        margin-bottom:0px;
        font-size:18px;
      }
      img {
        width:120px;
        height:auto;
      }
      &:hover {
        top: -8px;
        color:$body-font-color;
        h5 {
          color:$secondary-color;

        }
      }
        @include breakpoint(small only) {
          margin-bottom:20px;
        }
        @include breakpoint(medium only) {
          height:160px;
          padding:10px;
          img {
            width:80px;
          }
        }
    }
  }


  .cell.resources-ender {
    background: #3a913f;
    color:white;
    text-align:left;
    padding-top:40px;
    &:hover {
      color:white;
    }
    p {
      margin-bottom:10px;
    }
  }


  .ghost-resources {
    margin-top:50px;
    @include breakpoint(large up ) {
      max-width:55em;
    }
    @include breakpoint(medium down) {
      padding-left:20px;
      padding-right:20px;
    }
    .cell {
      transition: all 0.25s ease;
      position: relative;
      border:1px solid white;
      height: 250px;
      padding: 20px 20px;
      margin-bottom: 20px;
      display: flex;
      color: $body-font-color;
      @include breakpoint(medium only) {
       height:200px;

      }
      &:hover {
        .ghost-back {
          opacity:1;
        }
      }
    }
    .ghost-front {
      display:flex;
      height:100%;
      h5 {
        font-size:22px;
        color:white;
        align-self: flex-end;
        margin-bottom:0;
      }
    }
    .ghost-back {
      position:absolute;
      top:0;
      left:0;
      background:white;
      color:$secondary-color;
      width:100%;
      height:100%;
      font-size: 18px;
      justify-content: center; /* align horizontal */
      align-items: center; /* align vertical */
      text-align: center;
      opacity:0;
      display:flex;
      padding:20px;
      transition:opacity 0.2s ease;
    }
  }

  .calendar {
    min-height:105vh;
  }

  .vuecal--month-view .vuecal__cell-content {
    justify-content: flex-end;
    padding-bottom:8px;
  }

  // Remove ellipses...
  .vuecal--short-events .vuecal__event-title {
    white-space: normal;
    padding: 0 8px;
  }

.resource-content {
  width:100%;
